    //   <div class="user-img">
    //     <span class="first-text">АИ</span>
    //   </div>
    //   </section>
    // </div>

      // <Header />
      <BrowserRouter>
        <Routes>
          <Route exact path='/' component={<Main/>}/>
          <Route path='/step1' component={<Step1/>}/>
          <Route path='/step2' component={<Step2/>}/>
          <Route path='/step3' component={<Step3/>}/>
          <Route path='/result' component={<Result/>}/>
        </Routes>
      </BrowserRouter>
  );
}

export default App;
